column8:
782ギア社インシュレーション ライナージャケットです。<br>
超軽量、撥水性リップストップナイロンに、保温材として最軽量かつ高効率な中綿を採用、洗濯機で丸洗いも可能です。<br>
フロントフルジッパー開閉で、肩はラグランスリーブ仕様、中綿のズレを防ぐ1.5cm四方のクロスステッチが前面に6カ所、背面に5カ所施されています。<br>
脇の下は通気と動きを妨げない様に閉じられていないので大きく開いています。 <br><br>

ゴアテックスなどのハードシェルやソフトシェルジャケットのライナーとして最適なライナージャケットです。<br><br>

素材<br>
シェル：ナイロン100%<br>
ライニング：ナイロン100%<br>
インシュレーション：ポリエステル100%<br><br>

カラー：コヨーテブラウン<br>
Made in the USA<br><br>

実寸目安（約 cm） <br>
　　　　 胸幅 / 着丈 / 裄丈 <br>
サイズ S: 56 / 74 / 80cm <br>
