N-1デッキジャケットと同じジャングルクロスで構成され、艦艇甲板の作業着として支給されていた米海軍のデッキパーカーのモデルアップです。<br><br>

ウィリアムギブソンシリーズからのリリースなので、クラシカルな素材とディテールとなっていますが、全体的にブラックアウトされ、クラシカルでいて、精悍なイメージも合わせもっている洗練された雰囲気もあります。<br><br>

表地に耐久性、防風性が高いコットン・グログラン素材を使用し、裏地にはアルパカウールモヘア素材ならではの防風性、耐水性、それらによるクラシカルな防寒性があります。<br><br>

フードが付いている事やお尻が隠れる着丈により、体感の保温性を高めてくれます。<br>
袖口にはN-3Bと同様、内側リブ仕様になっておりますので、冷たい外気が入りにくいようになっています。<br><br>

 No.／BR13312<br>
マテリアル：ジャングルクロス<br>
ライニング：アルパカウールパイル<br>
ファスナー：ニッケル<br>
ボタン：ユリア樹脂<br>
ラベル：Naval Clothing Factory/William Gibson<br><br>

